import Navbar from "./Navbar";
import { BrowserRouter, Route, Routes } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
